ads.description:
Witam sprzedam E46 sedan z piecem M54B22. Autko jest po swapie z 318i, jest w pełni sprawne. Silnik jest w super stanie, nie pije oleju, jest suchy.  Posiada LPG wbite w dowód lecz niestety jeszcze nie założone, zbiornik ważny do 2029r. Dorzucam komplet gaz Staga R6.

Opłaty robione nowe jakieś 2 miesiące temu około. 



Posiada dołożony mpakiet przód + tył; lotka mpak;  gwint na całym aucie;  sporty skórzane z przodu;  

Prowadzi się bardzo dobrze, żadnych stuków w zawieszeniu jak i w napędzie. Nic nie stuka, nic nie puka, ma swoją moc i dobre przyspieszenie. 



Poniżej przedstawiam listę zrobionych rzeczy:

-swieże filtry, oleje i płyny chłodniczy;

-nowy filtr paliwa;

-nowa podpora wału;

-wspawane mocowania tylnego wózka;

-nowe tuleje na tylnym wózku i na wahaczach;

-nowy akumulator;



Podwozie jest w bdb stanie, nie ma żadnych dziur i nie leje się woda do środka. Lakierniczo również jest bdb, jedynie przednie błotniki do lekkich poprawek



Cena na kołach stalowych
